import pandas as pd
import io
import sys

# --- CONFIGURATION ---
BASE_COST_PER_KG = {
    'Surface': 15.0,
    'Express': 45.0,
    'Air Cargo': 85.0
}

def load_and_clean_data(csv_text):
    try:
        # 1. Load data with whitespace handling
        df = pd.read_csv(io.StringIO(csv_text.strip()), skipinitialspace=True)
        
        # 2. Critical: Clean all column names of hidden spaces/BOM characters
        df.columns = df.columns.astype(str).str.strip().str.replace('\ufeff', '')
        
        # 3. Verify 'Date' exists; if not, print available columns to help debug
        if 'Date' not in df.columns:
            print(f"Error: 'Date' column not found. Available columns: {list(df.columns)}")
            sys.exit(1)

        # 4. Date Conversion
        df['Date'] = pd.to_datetime(df['Date'], errors='coerce')
        df['Receive Date'] = pd.to_datetime(df['Receive Date'], errors='coerce')
        
        # 5. Numeric Cleaning
        numeric_cols = ['Actual Wt', 'Volumetric Wt', 'Chargeable Wt', 
                        'Tariff', 'VAS Charges', 'Total Amount']
        for col in numeric_cols:
            df[col] = pd.to_numeric(df[col], errors='coerce').fillna(0)
        
        # 6. Insights Calculations
        df['Lead_Time'] = (df['Receive Date'] - df['Date']).dt.days
        df['Est_Cost'] = df.apply(lambda x: x['Chargeable Wt'] * BASE_COST_PER_KG.get(x['Mode'], 20.0), axis=1)
        df['Profit'] = df['Total Amount'] - df['Est_Cost']
        df['Margin_Perc'] = (df['Profit'] / df['Total Amount']).replace([float('inf'), -float('inf')], 0).fillna(0) * 100
        
        return df
    except Exception as e:
        print(f"Failed to load data: {e}")
        sys.exit(1)

def generate_report(df):
    print("\n" + "="*60)
    print("                LOGISTICS INSIGHTS REPORT")
    print("="*60)
    
    # Financials
    total_rev = df['Total Amount'].sum()
    total_profit = df['Profit'].sum()
    avg_margin = df['Margin_Perc'].mean()
    
    # Operations
    avg_tat = df['Lead_Time'].mean()
    top_origin = df['Origin'].mode()[0]
    top_dest = df['Destination'].mode()[0]

    print(f"Total Consignments:   {len(df)}")
    print(f"Total Revenue:        ₹{total_rev:,.2f}")
    print(f"Estimated Net Profit: ₹{total_profit:,.2f}")
    print(f"Average Profit Margin: {avg_margin:.2f}%")
    print(f"Average Delivery TAT:  {avg_tat:.2f} Days")
    print("-" * 60)

    print("\n[PROFITABILITY BY MODE]")
    mode_stats = df.groupby('Mode').agg({
        'Consignment No': 'count',
        'Margin_Perc': 'mean',
        'Lead_Time': 'mean'
    }).rename(columns={'Consignment No': 'Shipments', 'Margin_Perc': 'Avg_Margin%', 'Lead_Time': 'Avg_Days'})
    print(mode_stats.round(2))

    print("\n[TOP 3 HIGHEST VALUE ROUTES]")
    df['Route'] = df['Origin'] + " to " + df['Destination']
    route_rev = df.groupby('Route')['Total Amount'].sum().sort_values(ascending=False).head(3)
    print(route_rev.apply(lambda x: f"₹{x:,.2f}"))

    print("\n[GST COMPLIANCE]")
    missing_gst = df['Sender GSTIN'].isna().sum()
    print(f"Shipments missing Sender GSTIN: {missing_gst} ({(missing_gst/len(df))*100:.1f}%)")
    print("="*60 + "\n")

